import { render } from '@testing-library/react';
import { Component } from 'react';
import './App.css';

class App extends Component{


  state = {
    age: 15,
    user: {
      name: "hager",
      lastName: "nabil"
    },

  }
  render(){
    return <div>
      my age {this.state.age}
    </div>
  }
}



export default App;
